import "./App.css";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import Navbar from "./components/Navbar";
import Reg from "./pages/Reg";
import Home from "./pages/Home";
import Rolunk from "./pages/Rolunk";
import Login from "./pages/Login";
import Autok from "./pages/Autok";



function App() {
  const user = route.params.paramKey;
  if(user == ""){
    document.get
  }

  return (
    <Router>
      { <Navbar /> }
      <Routes>
        <h1 className="User" style="display: none;"></h1>
        <Route path="/home" element={<Home />} />
        <Route routeName="reg" path="/reg" element={<Reg />} />
        <Route routeName="login" path="/login" element={<Login />} />
        <Route path="/rolunk" element={<Rolunk />} />
        <Route path="/autok" element={<Autok />} />
      </Routes>
    </Router>
  );
}

export default App;
